Накладные Наушники с микрофоном MDR MS 32/KR9309
создадут ощущение полного погружения в мир музыки, доставляя множество приятных минут своему обладателю. Цена подкреплена обширным функционалом, расширяющим привычные возможности аудиоустройства, выводя на новый уровень средств электроники.

Модель имеет ряд неоспоримых ключевых преимуществ, связанных с внедрением передовых технологий компанией-производителем:

реализуют коммуникационные возможности: оснащены микрофоном для передачи голосовой информации;
имеют высокую совместимость: подключаются к iPhone и Android;
оснащены пультом дистанционного управления для легкого переключения между режимами работы (воспроизведение мелодии продолжится после завершения разговора), а также настройки диапазона звучания и параметров голосового вызова.
Технические характеристики наушников:
диапазон частот: от 5 Гц до 22000 Гц – обширен, от очень тихих до громких звуков; благодаря технологии Bass Booster басы в низких частотах имеют яркую выраженность и усиление;
тип подключения: проводное – длина шнура составляет 1,2 метра, удобна для использования на расстоянии от источника воспроизведения музыкального трека, штекер диаметром 3,5 миллиметра универсален для подключения к большинству существующих устройств;
тип конструкции: складная – обеспечивает удобное хранение и транспортировку, а также защиту от повреждений;
тип динамиков: купольный, диаметр 30 мм; мягкие накладки создают защиту от натираний; обеспечивают закрытую звукоизоляцию;
материал корпуса: алюминий – прочен и долговечен. 
