Цветочный горшок - колонка  SPS Musik Pots \ Plant с поддержкой Bluetooth  
Элегантный дизайн горшка Smart Music Flower pots делает его отличным украшением вашего дома или рабочего места. Корпус горшка полностью водонепроницаем, поэтому вы можете не беспокоится о растении и поливать его столько, сколько требуется. Для портов имеются резиновые заглушки, а для отвода лишней воды специальное отверстие.

Цветочный горшок Smart Music Flower pots оснащен высококачественным динамиком мощностью 5 Вт. Подключается горшок-колонка к проигрывающим устройствам без проводов, используя Bluetooth. Теперь на вашем рабочем столе или прикроватной тумбочке не будет нагромождения из гаджетов. Ведь вы сможете послушать музыку и наслаждаться ею, глядя на своё любимое растение.

Также оснащен LED подсветкой и кнопками, отвечающими за переключение режимов (музыкальное воспроизведение, интерактивное взаимодействие, включение колонки, световые эффекты). Для зарядки устройства используется кабель micro USB, разъем под который эффектно скрыт заглушкой. Прорезиненные вставки снизу горшка не позволяют ему скользить. Внизу также находятся динамики и отверстия для оттока лишней жидкости.

