Частотный диапазон: 20 ~ 20 кГц;
Емкость батареи: 1200 мАч;
Время зарядки: около 4 часов;
Время работы: около 12 часов;
Размеры изделия: 114 х 114 х 117 мм;
Вес изделия: 400 гр;
Наличие LED подсветки.

